(43, 'Deviantart', 'On August 7, 2000, deviantART was launched to provide a central location for graphical artists to display their creations for feedback and exposure from peers. With an emphasis on digital works as pieces of art rather than desktop eye candy, the community grew rapidly. deviantART continues to commit itself to responding to the creative outlet needs of its members, releasing and revamping categories as interest grows. From humble beginnings as primarily a static image file gallery, deviantART is now proud to host poetry, photography, and flash exhibits, as well as an enormous Indyart and wallpaper sections and skins for 105 applications.', 'art, artist, artistic, poem, poetry, poet, theme, shell, photography, photo, texture, design, website, tutorial, photoshop, bryce, paint shop pro, dreamweaver, poser, wallpaper, desktop, wallpaper, images, graphics, freeware, space, 3d, electronic art, lightwave, ray dream studio, hi-res, raytraced, animated startups, computer, graphic design, planetscapes, rendered art, application skins, user interface enhancements, visual style, windows xp, uis, skin, skins, skinning, skinz, winamp, icq, icqplus, mp3, music, yahoo, @time, 3d-ftp, axe, axion chat, babelfish, beatnik, boxcard, boxip, boxchess, buddyphone, c-4, cd stomper, chroma, codename2, coolplayer, cool desk, digideck, efx, ezpop, imesh, k-jofol, launchkaos, memopad, musicmatch, mycq, mypad, sonique, sysmeter, unrealplayer, winamp, windowblinds, afterstep, enlightenment, KDE, windows, darkstep, icesphere, litestep, hoverdesk nextstart, talisman, icons, iconpackager, geoshell, visualization, preset, screenshot', 'https://web.archive.org/web/20020808131057if_/http://www.deviantart.com:80/', '2002-08-08', 0, 0, '', '', '', '', '', '', ''),
